%pyspark
def return_columns(how = 'list'):
    if how == 'list':
        return ['source_id', 'parallax', 'ra', 'dec', 'l', 'b', 'pmra', 'pmdec',
                'phot_g_mean_mag', 'phot_bp_mean_mag', 'phot_rp_mean_mag', 'g_rp']
    elif how =='str':
        return 'source_id, parallax, ra, dec, l, b, pmra, pmdec, \
                phot_g_mean_mag, phot_bp_mean_mag, phot_rp_mean_mag, g_rp'

%pyspark

def initial_query(columns, how, limit = None, tablename = 'dcr_raw_sources', make_queryable = False, 
                    return_table = False, additional_cuts = ''):
    if how == 'NoLimit':
        raw_sources_df = spark.sql(f'SELECT {columns} \
                                     FROM gaia_source as a \
                                     WHERE {additional_cuts}')
    elif how == 'limited':
        raw_sources_df = spark.sql(f'SELECT {columns} FROM gaia_source \
                                        WHERE {additional_cuts} \
                                        (1/parallax < limit)')
    elif how == 'sampled':
        sample_filter = f' WHERE MOD(source_id, {limit}) = 0'
        raw_sources_df = spark.sql(f'SELECT {columns} FROM gaia_source \
                                    {sample_filter} \
                                    AND {additional_cuts}')

    else: raise NameError('how must equal: ["NoLimit", "limited", "sampled"]')

    if make_queryable:
        raw_sources_df.createOrReplaceTempView(tablename)
        # print(f'data at: {tablename}')
    if return_table:
        return raw_sources_df

def applyQualityControl(catalogue, QCcatalogue, threshold = 0.0):
    df = spark.sql(f'SELECT a.*, b.is_good, b.confidence \
                FROM {catalogue} as a, \
                {QCcatalogue} as b\
                WHERE (b.source_id == a.source_id AND b.is_good == 1.0 AND b.confidence > {threshold})')
    return df

def addAbsoluteMag(df, passband = 'g'):
    return df.withColumn(f'm_{passband}', col(f'phot_{passband}_mean_mag') \
                             + 5.0*log10(col('parallax')/100))

def get_data(makeQueryable = 'dcr_raw_sources', sampled = False,
             qualityControl = False, limit = 5000, threshold = 0.0,
             addAbsolute = False, additional_cuts = ''):
    ''' Gets a subsample of eDR3 data and appends the wds. (labelled) '''

    if not sampled:
        sampled = 'sampled'

    df = initial_query(columns = return_columns(how = 'str'), how = sampled, limit = limit, return_table = True, additional_cuts = additional_cuts)

    if addAbsolute:
        df = addAbsoluteMag(df = df, passband = 'g')

    if makeQueryable:
        # print(f'data queryable from {makeQueryable}')
        df.createOrReplaceTempView(makeQueryable)

    if qualityControl:
        if not makeQueryable:
            raise nameError('For quality control makeQueryable must be True')
        df = applyQualityControl(catalogue = makeQueryable, QCcatalogue = 'dcr_spurious_sources', threshold = threshold)
        df.createOrReplaceTempView(makeQueryable)
    return df

