def reshape_input(Input, padding = 1, desired_length = 2):
    '''reshapes input into list of lists padded/cut to a standard desired length

    EXAMPLE
        input = [[cos, cos], [sin], [cos, sin, cos],
                 [sin, cos], [cos], [sin, sin],
                   [sin],     [0],    [cos]]

        new_input =  reshape_input(input, padding = 1) 

        new_input = [[cos, cos], [sin, 1], [cos, sin],
                     [sin, cos], [cos, 1], [sin, sin],
                      [sin, 1],   [0, 1],   [cos, 1]]
        '''

    for i in Input:
        if len(i) < desired_length:
            while len(i) < desired_length:
                i.append(padding)
        elif len(i)>desired_length: 
            while len(i) > desired_length:
                i.pop()
    return Input

def element_transform(function, col_name, sign = 1, padding = 1, col_units = 'degrees'):
    '''Returns the spark syntax to select and transform columns from a dataframe
    '''

    if function == padding:
        return 1

    elif type(function) == int: 
        return lit(function)

    else:
        if col_units == 'degrees':
            conv=pi/180
        else:
            conv = 1
        return sign*function(col(col_name)*conv)

def drop_matrix_from_dataframe(df, name):
    '''Drops matrix from the dataframe, assuming the column names
    use function: "create_matrix_index" notation. '''
    drop = [i for i in df.columns if name in i]
    df = df.select([column for column in df.columns if column not in drop])
    return df

def create_matrix_index(N,M, matrix_name = 'A'):
    '''Creates index for matrix column names.'''
    indicies=[]
    for i in range(M):
        for j in range(N):
            indicies.append('{}{}{}'.format(matrix_name,i,j))
    return indicies

def drop_DataFrame(df, matrix_cols, signs, names, drop_df = True):
    '''Drops input DataFrame columns after calulation'''

    if drop_df == True:
        A = df.select([c for c in matrix_cols])
        for i in range(len(signs)):
            A = A.withColumnRenamed(A.columns[i], names[i])
        return A
    else:
        for i in range(len(matrix_cols)):
            df = df.withColumn(names[i], matrix_cols[i])

        index = len(df.columns) - len(signs)
        for i in range(len(signs)):
            df = df.withColumnRenamed(df.columns[index+i], names[i])
        return df
